script: |
  super -f text -I q12546.spq | sort > q12546.out

inputs:
  - name: q12546.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE + 38 + - col1 * + col1 * 59 NOT IN ( ( + - col2 ) * + + col2 * + - col1, col2 + + + 54 );
  - name: tab2

outputs:
  - name: q12546.out
    data: |
      46	51	23
      64	77	40
      75	67	58
